  @override
  @optionalTypeArgs
  TResult? mapOrNull<TResult extends Object?>({
    TResult Function(_Initial value)? initial,
    TResult Function(FixturesLoading value)? fixturesLoading,
    TResult Function(FixturesLoaded value)? fixturesLoaded,
    TResult Function(FixturesFailed value)? fixturesFaild,
  }) {
    return fixturesFaild?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(_Initial value)? initial,
    TResult Function(FixturesLoading value)? fixturesLoading,
    TResult Function(FixturesLoaded value)? fixturesLoaded,
    TResult Function(FixturesFailed value)? fixturesFaild,
    required TResult orElse(),
  }) {
    if (fixturesFaild != null) {
      return fixturesFaild(this);
    }
    return orElse();
  }
}

abstract class FixturesFailed implements FixturesState {
  const factory FixturesFailed() = _$FixturesFailed;
}
